import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        Hello world
        <FirstComponent></FirstComponent>
      </div>
    );
  }
}

class FirstComponent extends Component {
  render() {
    return (
      <div className='FirstComponent'>
        first component
      </div>
    )
  }
}

export default App;
